"use strict";(self.webpackChunkdp_dokumentasjon=self.webpackChunkdp_dokumentasjon||[]).push([[6387],{6387:(e,n,r)=>{r.r(n),r.d(n,{default:()=>t});const t='---\nsidebar_position: 1\n---\n\n# Frontend\n\nInnsynnside for dagpenger.\n\n## Form\xe5l\n\nBruker skal kunne se oversikt over dagpengers\xf8knader bruker har sendt til NAV. Oversikt over dokumenter. Muligheter for \xe5 ta kontakt med NAV.\n\n## Teknologier\n\n- Rammeverk: next 12\n- Testing: Jest 27\n- Node 18.12.0\n- MSW: 1.3.2\n\n## App-arkitektur\n\nDenne applikasjonen har bare \xe8n side.\n\n### Sidestruktur\n\n#### PageHero\n\nSide titel med arbeidss\xf8kerstatus vi henter fra. Arbeidss\xf8kerstatus er informasjon om bruker er registrert som arbeidss\xf8ker og det kan v\xe6re enten "registert" eller "ikke registert".\n\n#### Soknader\n\nLister over p\xe5begynte og fullf\xf8rte s\xf8knader siste 12 uker. Bruker kan fortsette med s\xf8knaden fra p\xe5begynte s\xf8knader. Fullf\xf8rte s\xf8knader har bruker muligheter for \xe5 se s\xf8knaden eller ettersende dokumenter.\n\n#### AccountNumber\n\nVise kontonummer henter fra [Sokos kontoregister for person](https://github.com/navikt/sokos-kontoregister-person). Dersom bruker ikke har registert tidligere vil bruker f\xe5r mulighet for \xe5 gj\xf8re det.\n\n#### MeldFraOmEndring\n\nDenne seksjonen kan bruker sende melding til NAV eller sende inn dokument (Generell innsending)\n\n#### Shortcut\n\nSnarveier til **Send klage**, **Sp\xf8rsm\xe5l om saken din**, **Forskudd p\xe5 dagpenger** og **Ny s\xf8knad**\n\n#### JournalpostList\n\nLister over dokumenter bruker har sendt inn tidligere med mulighet for \xe5 laste ned eller forh\xe5ndvise.\n\n#### NosessionModal\n\nDen viser en modal n\xe5r sesjon er utl\xf8pt. Sesjonen varer 30 minutter.\n\n### Eksterne tjenester / Netverkskart\n\n```mermaid\nflowchart TB\n    veilarbregistrering--\x3edp-dagpenger;\n    safselvbetjening--\x3edp-dagpenger;\n    sokos-kontoregister-person--\x3edp-dagpenger;\n```\n\nTODO:\n\n- Hvordan fungerer applikasjonen internt?\n\n## Utfordringer\n\n- Dokument h\xe5ntering er vanskelig \xe5 forst\xe5r. Denne trenger omskriving/opprydding.\n  - Kompleksiteten ligger mest i [Backend for Frontend](https://github.com/navikt/dp-dagpenger/blob/main/src/pages/api/dokumenter/index.ts)\n- Vanskelig \xe5 oppdatere til neste Next og MSW.\n- Bruker har ikke mulighet \xe5 f\xf8lge med p\xe5 s\xf8knadsstatus.\n- Denne applikasjonen mangler oppsett for Faro.\n- Ettersending av dokumenter kan gj\xf8res kun \xe8n gang. Dette m\xe5 vi dobbeltsjekke om det fortsatt er en feil!\n\n## Lenker\n\n- [Github](https://github.com/navikt/dp-dagpenger)\n- Grafana Faro\n- [Amplitude](https://app.eu.amplitude.com/analytics/nav/dashboard/5z4xqqz)\n- Oppgaver i favro\n- [Tilgjengelighetserkl\xe6ring](https://a11y-statement.nav.no/reports/1b32d0fd-983b-44f2-8f64-6f1ae6760c64)\n- Annen bakgrunnsinformasjon\n'}}]);